import React from "react";
import { Link } from "react-router-dom";

function menu(props) {
  return (
    <div className="menu-mobile">
      <div className="menu-links">
        <Link onClick={props.closeModal}  to="/">Home</Link>
        <Link onClick={props.closeModal} to="/work">Work</Link>
        <Link onClick={props.closeModal} to="/about">About</Link>
      </div>
    </div>
  );
}

export default menu;
